import React from 'react';

const LandingPage = () => {
    return (
        <div>
            <h1>Welcome to Parvarish</h1>
            <p>Your trusted daycare booking system.</p>
            <p>Sign up or log in to get started!</p>
        </div>
    );
};

export default LandingPage;
